	/**
	 * Returns the number of rows matching criteria, joining all related tables
	 *
	 * @param      Criteria $c
	 * @param      boolean $distinct Whether to select only distinct columns; deprecated: use Criteria->setDistinct() instead.
	 * @param      PropelPDO $con
	 * @param      String    $join_behavior the type of joins to use, defaults to Criteria::LEFT_JOIN
	 * @return     int Number of matching rows.
	 */
	public static function doCountJoinAll(Criteria $criteria, $distinct = false, PropelPDO $con = null, $join_behavior = Criteria::LEFT_JOIN)
	{
		// we're going to modify criteria, so copy it first
		$criteria = clone $criteria;

		// We need to set the primary table name, since in the case that there are no WHERE columns
		// it will be impossible for the BasePeer::createSelectSql() method to determine which
		// tables go into the FROM clause.
		$criteria->setPrimaryTableName(CompanyPeer::TABLE_NAME);

		if ($distinct && !in_array(Criteria::DISTINCT, $criteria->getSelectModifiers())) {
			$criteria->setDistinct();
		}

		if (!$criteria->hasSelectClause()) {
			CompanyPeer::addSelectColumns($criteria);
		}

		$criteria->clearOrderByColumns(); // ORDER BY won't ever affect the count

		// Set the correct dbName
		$criteria->setDbName(self::DATABASE_NAME);

		if ($con === null) {
			$con = Propel::getConnection(CompanyPeer::DATABASE_NAME, Propel::CONNECTION_READ);
		}

		$criteria->addJoin(array(CompanyPeer::COUNTRY_ID,), array(CountryPeer::ID,), $join_behavior);
		$criteria->addJoin(array(CompanyPeer::CITY_ID,), array(CityPeer::ID,), $join_behavior);
		$criteria->addJoin(array(CompanyPeer::STATUS_ID,), array(StatusPeer::ID,), $join_behavior);
		$criteria->addJoin(array(CompanyPeer::COMPANY_SIZE_ID,), array(CompanySizePeer::ID,), $join_behavior);
		$criteria->addJoin(array(CompanyPeer::COMPANY_TYPE_ID,), array(CompanyTypePeer::ID,), $join_behavior);
		$criteria->addJoin(array(CompanyPeer::CUSTOMER_TYPE_ID,), array(CustomerTypePeer::ID,), $join_behavior);
		$criteria->addJoin(array(CompanyPeer::APARTMENT_FORM_ID,), array(ApartmentFormPeer::ID,), $join_behavior);
		$criteria->addJoin(array(CompanyPeer::INVOICE_METHOD_ID,), array(InvoiceMethodPeer::ID,), $join_behavior);
		$criteria->addJoin(array(CompanyPeer::ACCOUNT_MANAGER_ID,), array(UserPeer::ID,), $join_behavior);
		$criteria->addJoin(array(CompanyPeer::AGENT_COMPANY_ID,), array(AgentCompanyPeer::ID,), $join_behavior);

    foreach (sfMixer::getCallables('BaseCompanyPeer:doCount:doCount') as $callable)
    {
      call_user_func($callable, 'BaseCompanyPeer', $criteria, $con);
    }


		$stmt = BasePeer::doCount($criteria, $con);

		if ($row = $stmt->fetch(PDO::FETCH_NUM)) {
			$count = (int) $row[0];
		} else {
